const Portfolio = (props) => {
  return (
    <div
      style={props.activePortfolioZ ? { zIndex: "-1" } : { zIndex: "99" }}
      className={
        props.activePortfolio
          ? "portfolio-cont"
          : "portfolio-cont active-portfolio"
      }
    >
      <div
        className={
          props.activePortfolio ? "portfolio" : "portfolio active-portfolio"
        }
      >
          <button>
          <img src="/images/gears.svg" alt="Options Icon"/>
          </button>

        <div>
          <h1>Portfolio</h1>
          <img src="/images/bounce.svg" alt="Stock Arrow Bounce" />
        </div>

        <div>
          <form>
            <input type="text" placeholder="Enter Stock Ticker" />
            <input type="submit" value="Add Stock" />
          </form>
        </div>

        <div className="portfolio-holder">

        </div>


      </div>
    </div>
  );
};

export default Portfolio;
